/**
 * Thrown in case a feature is not supported.
 * @extends {external:Error}
 * @alias module:errors.FeatureNotSupportedError
 */
class FeatureNotSupportedError extends Error {
  /**
   * Create a FeatureNotSupportedError.
   */
  constructor () {
    super('This feature is not supported')
    this.name = this.constructor.name
    Error.captureStackTrace(this, this.constructor)
  }
}

module.exports = FeatureNotSupportedError
